1|=phpok=|0.00148|=phpok=|UPDATE qinggan_list_22 SET `site_id`='1',`project_id`='43',`cate_id`='8',`thumb`='1366',`note`='',`content`='<p>在 PHPOK5 版本中，我们正式引入了【开发模式】及【应用模式】两个概念。</p><h2>开发模式</h2><p>顾名思义，就是用于网站开发过程中要用到的，如增加模块，扩展字段等等功能。这些功能更适合开发者对整个平台的设置，切换后效果如下，功能完整，操作比较复杂。</p><p><img src=\"https://www.phpok.com/res/201810/19/auto_10154.png\" title=\"图片\" alt=\"图片\"/><br/></p><h2>应用模式</h2><p>适用于网站做好后，需要在网站里填充内容的。</p><p><img src=\"https://www.phpok.com/res/201810/19/auto_10155.png\" title=\"图片\" alt=\"图片\"/></p><p>两都最主要的区别在于：应用模式下，不能自己扩展字段！</p><h2>开启模式切换</h2><p>配置文件：_config/global.ini.php 设置参数</p><div><div class=\"syntaxhighlighter  bash\"><pre class=\"brush:bash;toolbar:true\">develop&nbsp;=&nbsp;true</pre><p>如果此项设置为 false，后台只有应用模式！</p></div></div><p>强列建议网站上线后将此项设置为 false</p>' WHERE `id`='1936'
